import React from "react";
import { render } from "react-dom";
import { makeData, Logo, Tips } from "./Utils";
import sampleData from "./sample.js";

// Import React Table
import ReactTable from "react-table";
import "react-table/react-table.css";

const columns = [
  {
    id: "col16",
    Header: () => {
      return (
        <div>
          <div className="col1-heading">Col 1</div>
          <div className="col6-heading">Col 6</div>
        </div>
      );
    },
    accessor: d => {
      return (
        <div>
          <div className="col1">{d.firstName}</div>
          <div className="col6">{d.lastName}</div>
        </div>
      );
    },
    width: 100
  },
  {
    id: "col27",
    Header: () => {
      return (
        <div>
          <div className="col2-heading">Col 2</div>
          <div className="col7-heading">Col 7</div>
        </div>
      );
    },
    accessor: d => {
      return (
        <div>
          <div className="col2">{d.firstName}</div>
          <div className="col7">{d.lastName}</div>
        </div>
      );
    },
    width: 200
  },
  {
    id: "col38",
    Header: () => {
      return (
        <div>
          <div className="col3-heading">Col 3</div>
          <div className="col8-heading">Col 8</div>
        </div>
      );
    },
    accessor: d => {
      return (
        <div>
          <div className="col3">{d.firstName}</div>
          <div className="col8">{d.lastName}</div>
        </div>
      );
    },
    width: 100
  },
  {
    id: "col49",
    Header: () => {
      return (
        <div>
          <div className="col4-heading">Col 4</div>
          <div className="col9-heading">Col 9</div>
        </div>
      );
    },
    accessor: d => {
      return (
        <div>
          <div className="col4">{d.firstName}</div>
          <div className="col9">{d.lastName}</div>
        </div>
      );
    },
    width: 100
  },
  {
    id: "col510",
    Header: () => {
      return (
        <div>
          <div className="col5-heading">Col 5</div>
          <div className="col10-heading">Col 10</div>
        </div>
      );
    },
    accessor: d => {
      return (
        <div>
          <div className="col5">{d.firstName}</div>
          <div className="col10">{d.lastName}</div>
        </div>
      );
    },
    width: 100
  },
  {
    id: "col11",
    Header: "Col 11",
    columns: [
      {
        id: "scol11a",
        Header: "Sub Col 11a",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      },
      {
        id: "scol11b",
        Header: "Sub Col 11b",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      },
      {
        id: "scol11c",
        Header: "Sub Col 11c",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      },
      {
        id: "scol11d",
        Header: "Sub Col 11d",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      }
    ]
  },
  {
    id: "col12",
    Header: "Col 12",
    columns: [
      {
        id: "scol12a",
        Header: "Sub Col 12",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      }
    ]
  },
  {
    id: "col13",
    Header: "Col 13",
    columns: [
      {
        id: "scol13a",
        Header: "Sub Col 13a",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      },
      {
        id: "scol13b",
        Header: "Sub Col 13b",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      },
      {
        id: "scol13c",
        Header: "Sub Col 13c",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      },
      {
        id: "scol13d",
        Header: "Sub Col 13d",
        accessor: d => {
          return d.firstName;
        },
        width: 80
      }
    ]
  }
];

class Table1 extends React.Component {
  constructor() {
    super();
    this.state = {
      data: makeData()
    };
  }
  render() {
    const { data } = this.state;
    return (
      <div>
        <table>
          <tr>
            <th>First name</th>
            <th>Last name</th>
            <th>Age</th>
          </tr>

          {sampleData.map((item, i) => {
            return (
              <tr key={i}>
                <td>{item.firstName}</td>
                <td>{item.lastName}</td>
                <td>{item.age}</td>
              </tr>
            );
          })}
        </table>
      </div>

    );
  }
}
export default Table1;

